import styled from "styled-components";

export const PagesWrap = styled.div`
  width: 90rem;
  height: 37rem;
  margin: 0 auto;
  margin-top: 11.25rem;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

export const EffectDiv = styled.div`
  width: 11rem;
  height: 3.2rem;
  line-height: 3.2rem;
  box-shadow: 3.5px 4px 5px #8c08ca;
  border-radius: 50px;
  margin-bottom: 2.2rem;
  font-size: 2rem;
`;
